def select_leaves(adjacency_matrix):
    degree = []
    length = len(adjacency_matrix)
    for i in range(length):
        degree.append(0)
    for i in range(length-1):
        for j in range(i+1, length):
            if adjacency_matrix[i][j] != 'x':
                degree[i] += 1
                degree[j] += 1
    leaves = []
    covered = set()
    for i in range(length):
        if degree[i] == 1:
            leaves.append(i)
            covered.add(i)
    if len(leaves) != 0:
        neighbors, non_leaves = find_neighbors(adjacency_matrix, leaves)
        second = set()
        for i in range(len(leaves)):
            for neighbor in neighbors[leaves[i]]:
                second.add(neighbor)

        chosen = []
        append_leaves = []
        # print(6 in second)
        for i in second:
            leaves_cost = 0
            connected_leaves = []
            covered.add(i)
            for j in range(length):
                if adjacency_matrix[i][j] != 'x' and j in leaves:
                    leaves_cost += 2*adjacency_matrix[i][j]
                    leaves_cost += adjacency_matrix[j][j]
                    connected_leaves.append(j)
            if leaves_cost >= adjacency_matrix[i][i]:
                chosen.append(i)
                for j in neighbors[i]:
                    covered.add(j)
                for j in connected_leaves:
                    leaves.remove(j)
            else:
                summation = leaves_cost
                for j in non_leaves[i]:
                    summation += 2*adjacency_matrix[i][j]
                    summation += adjacency_matrix[j][j]
                if summation < adjacency_matrix[i][i]:
                    append_leaves += connected_leaves
                # if i == 6:
                #     print(non_leaves[6])
                #     print(summation, append_leaves)


        must_be_chosen = chosen + append_leaves
        uncovered = []
        unchosen = []
        for i in range(length):
            if i not in covered:
                uncovered.append(i)
            if i not in must_be_chosen:
                unchosen.append(i)
        return must_be_chosen, unchosen, covered, uncovered
    else:
        uncovered = []
        unchosen = []
        for i in range(length):
            uncovered.append(i)
            unchosen.append(i)
        return [], unchosen, set(), uncovered



def find_neighbors(adjacency_matrix, leaves):
    length = len(adjacency_matrix)
    result = []
    result_with_non_leaves = []
    for i in range(length):
        result.append([])
        result_with_non_leaves.append([])
    for i in range(length-1):
        for j in range(i+1, length):
            if adjacency_matrix[i][j] != 'x':
                result[i].append(j)
                result[j].append(i)
                if i not in leaves:
                    result_with_non_leaves[j].append(i)
                if j not in leaves:
                    result_with_non_leaves[i].append(j)
    return result, result_with_non_leaves

def weighted_cost(adjacency_matrix, covered, i, c_weight, d_weight):
    distance_total = -adjacency_matrix[i][i]
    degree = 1
    for j in range(len(adjacency_matrix)):
        if adjacency_matrix[i][j] != 'x':
            distance_total += adjacency_matrix[i][j]
            if j not in covered:
                degree += 1
    total_cost = round((c_weight * adjacency_matrix[i][i] + d_weight * distance_total)/degree, 7)
    return total_cost


def setcoverV3(adjacency_matrix, chosen, unchosen, covered, uncovered, c_weight, d_weight):
    h = []
    result = chosen
    length = len(adjacency_matrix)
    while len(covered) != length:
        # print(len(covered), length)
        new_city = unchosen[0]
        weight = weighted_cost(adjacency_matrix, covered, new_city, c_weight, d_weight)
        for i in unchosen:
            rec = weighted_cost(adjacency_matrix, covered, i, c_weight, d_weight)
            if rec < weight:
                new_city = i
                weight = rec
        unchosen.remove(new_city)
        change = False
        for i in range(length):
            if adjacency_matrix[new_city][i] != 'x' and i not in covered:
                covered.add(i)
                change = True
        if change:
            result.append(new_city)
    return result

